import Footer from '../../components/Footer';
import CreateAcct from '../../components/CreateAcct';


const NewAcct = () => {
    return (
        <div>
          <Navbarhome />
          <CreateAcct />
          <Footer />  
        </div>

    )
}
export default NewAcct;
